import React from 'react';

function Home() {
  
  var token = localStorage.getItem('token');
  var pp = localStorage.getItem('profilephoto');
 
  return (
    <div className="container" style={{marginBottom:"100px"}}>
        <div className="row">
            
          
            <div className="col-md-12"  style={{border:"1px solid #84c225",paddingTop:"10px"}}>
            <h5 className="alert  text-light" style={{backgroundColor:'#84c225'}}>
            <ViewListIcon />Shop By Category 
            </h5>
            </div>
         </div>   

    </div>
  );
}

export default Home;
